import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Boboi',
          id: '123'
        },
        {
          name: 'Andeyo',
          id: '124'
        },
        {
          name: 'Adudu',
          id: '125'
        },
        {
          name: 'Onit',
          id: '126'
        },
      ]
    };
  }

  render () {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return <div key={monster.id}><h1>{monster.name}</h1></div>
          })
        }
      </div>
    );
  } 
}

export default App;
